import React, {useState, useEffect} from "react";
import api from "../api/axios";

export default function PatientsPage(){
  const [items,setItems] = useState([]);
  useEffect(()=> fetchList(),[]);
  const fetchList = async ()=> {
    try {
      const r = await api.get("/patients");
      setItems(r.data);
    } catch (err) { setItems([]); }
  };
  return (
    <div>
      <h2>Patients</h2>
      <table style={{width:"100%",borderCollapse:"collapse"}}>
        <thead><tr><th>Name</th><th>Contact</th><th>Actions</th></tr></thead>
        <tbody>
          {items.map(p => (
            <tr key={p._id}><td>{p.first_name} {p.last_name}</td><td>{p.contact}</td><td><button onClick={()=>navigator.clipboard.writeText(p._id)}>Copy ID</button></td></tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
